import React from 'react';
import Card from './CharacterCard';

const TeamList = (props) => {
  const cardArray = props.teamStudents.map(student => <Card handleToggle={props.handleToggle} studentData={student}/>)

  return (
    <div id="team-list">
      <h2>My Wizarding Team</h2>
      {cardArray}
    </div>
  )
}

export default TeamList;
